pragma solidity >=0.7.0 < 0.9.0;

/*
    Money Box는 3의 배수 번쨰 사람에게 적립된 이더를 준다.
    
    1. 1이더만 내야한다
    2. 중복해서 참여 불가(단, 누군가 적립금을 받으면 초기화)
    3. 관리자만 적립된 이더 볼 수 있다.
    4. 3의 배수 번째 사람에게만 적립 이더를 준다.
*/

contract MoneyBox {
    event WhoPaid(address indexed sender, uint256 payment);

    // 베포자
    address ownwer;

    mapping (uint256=>mapping(address => bool)) paidMemberList; // { uint256 : { address : bool } }
    uint round = 1;

    constructor() {
        ownwer = msg.sender;
    }

    function checkRound() public view returns(uint256) {
        return round;
    }
}

